import React from 'react'
//import axios from 'axios'


class Task extends React.Component {

    constructor(props) {
        super(props);
    }



    render() {
        return (

            <div name="tasks" className="row">
                <div className="row bg-white">
                    <div className="col-md-1 border p-2 text-center">
                        <input type="checkbox" />
                    </div>
                    <div className="col-sm border ">
                        Task name1..
    				</div>
                    <div className="col-md-1 text-center border">
                        <button type="button" className="btn btn-warning">E</button>
                    </div>
                    <div className="col-md-1 text-center border">           
                        <button type="button" className="btn btn-danger">D</button>
                    </div>
                </div>

            </div>

        )
    }
}

export default Task
